    "neighborhood": "Queens",
    "image": "https://i.pinimg.com/474x/47/b1/d3/47b1d3175589f19f58a35cfcd78b3e73--city-restaurants-mexican-restaurants.jpg",
    "cuisineType": "638f1d33b7f3872046553825",
    "owner": "65aa9eac5e7211c08fed7ef8",
    "reviews": [
        {
            "_id": "65e776bc876d1fcf66f0819c",
            "comment": "Head to this laid-back Long Island City restaurant for beef tongue tacos, chicken smothered in a heady mole sauce, and a monster crab tostada. New York's only Michelin-starred Mexican restaurant is an especially cool choice for lunch during the week or drinks after work. Eater critic Ryan Sutton awarded this restaurant two stars.",
            "owner": {
                "_id": "65e7512ff226b066d0c7f3d3",
                "username": "Steve"
            },
            "rating": 5,
            "createdAt": "2024-03-05T19:47:08.027Z",
            "updatedAt": "2024-03-05T19:47:08.027Z",
            "__v": 0
        },
        {
            "_id": "65e77984876d1fcf66f081af",
            "comment": "For a Michelin star restaurant, it's fairly priced and the food is fairly good. Started with a strawberry margarita which was good in flavor but not much alcohol. Had the chicken enchiladas with salsa verde and it was really good. Great balance in flavor and a good portion. Extra tasty with their hot sauces. My wife had the lamb but it was a bit too salty for our taste. Although, it was cooked very well and fell off the bone. The highlight of the night was the tres leches cake. Probably the best I've ever had to be honest. Not too sweet and very milky. Overall, one of my top 3 favorite Mexican in NY.",
            "owner": {
                "_id": "65e778c6876d1fcf66f081a7",
                "username": "Jason"
            },
            "rating": 4,
            "createdAt": "2024-03-05T19:59:00.034Z",
            "updatedAt": "2024-03-05T19:59:00.034Z",
            "__v": 0
        },
        {
            "_id": "65e77e31876d1fcf66f08226",
            "comment": "The hype was real. Please go. Get the ceviche. And the tres leches. You're welcome",
            "owner": {
                "_id": "65e77e1c876d1fcf66f08223",
                "username": "Rob"
            },
            "rating": 5,
